class InputValue extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            value: '',
        }
    }

    handleValue = (e) => {
        console.log(this.state.value)
    }
    
    render() {
        return(
            <form>
                <input type='text'/>
                <p>{this.state.value}</p>
            </form>
        )
    }
};

export default InputValue;
